import React from "react";

function CheckOut() {
  async function handleSubmit(values) {
    console.log(values);
  }


  const formik = useFormik({
    initialValues: {
      details: "",
      phone: "",
      city: "",
    },
    onSubmit: handleSubmit,
  });
  return ;
}

export default CheckOut;
